import React from 'react';

import moment from 'moment';
import { useSelector } from 'react-redux';

import {
  CircularProgress,
  TableBody as TableBodyMui,
  TableRow,
} from '@mui/material';

// import { makeStyles } from '@mui/styles';
import { RootState } from '../../store/store';
import { tableDataType } from '../../store/types';
import TableCell from '../table/table-cell';

// const useStyles = makeStyles({
//     table_row: {
//         border: '1px solid #E3E6EC',
//     },

//     secondary_text: {
//         color: '#908f8f',
//     },
// });


function TableBody(): React.ReactElement {
    // const classes = useStyles();
    const tableData = useSelector((state: RootState) => state.tableData.data)
    const isLoading = useSelector((state: RootState) => state.tableData.isLoading)

    return (
        <TableBodyMui>
            {isLoading && <CircularProgress />}
            {!isLoading && !!tableData.length &&
                tableData.map(({
                    id,
                    created_date,
                    order_type,
                    account, }: tableDataType) => <TableRow key={data.id}>
                        <TableCell
                            text={data.id}
                            secondaryText={moment(data.created_date).format('DD.MM.yyyy HH:mm')}
                        />
                        <TableCell
                            text={data.order_type?.name}
                            secondaryText={`${data.created_user.surname} ${data.created_user.name[0]}. ${data.created_user.patronymic[0]}`}
                        />
                        <TableCell
                            text={data.account?.name}
                            secondaryText={data.terminal?.name}
                        />
                        <TableCell status={data.status} />
                    </TableRow>)}
        </TableBodyMui>
    );
}

export default TableBody
